sys_variable_value.value:
(function execute(inputs, outputs) {
    var stream = sn_fd.FlowAPI.executeDataStreamAction('sn_gogle_vpn_spoke.fetch_sub_networks', {
        "project_id": inputs.projectid,
        "region": inputs.region
    });
    var obj = []
    while (stream.hasNext()) {
        obj.push(stream.next())
    }
    var subnetworks = [];
    obj.forEach(function(subnetworkObj) {
        subnetworks.push({
            "label": subnetworkObj.name.toUpperCase(),
            "name": subnetworkObj.name
        });
    })
    outputs.subnetworks = {
        data: subnetworks
    }
})(inputs, outputs);

